import React from "react";

const DetailInfo = (props) => {
  return (
    <div className="container">
      {props.info.map((info) => {
        return (
          <div className="row">
            <div className="col-12 col-lg-8">
              <h3>{info.title}</h3>
              <p>{info.description}</p>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default DetailInfo;
